frontApp.controller("homeController",["$scope","$http","$window","CategoryPost",function(n,t){n.products=[];n.posts=[];n.spNoiBats=[];t.get("/API/PostsAPI/").success(function(t){angular.forEach(t,function(t){n.posts.push(t)})});t.get("/API/ProductsAPI/").success(function(t){n.products=t;angular.forEach(t,function(t){t.feature==1&&n.spNoiBats.push(t)})})}]);